import { createRouter, createWebHistory } from "vue-router";


const routes = [
    {
        path: "/mychart",
        name: "MyChart",
        component: () => import("../components/MyChart.vue"),
    },
    {
        path: "/hello",
        name: "Navbar",
        component: () => import('../components/Navbar.vue'),
    },
    {
        path: "/upload",
        name: "Upload",
        component: () => import ('../components/Upload.vue')
    },
    {
        path: "/footer",
        name: "Footer",
        component: () => import ('../components/MainFooter.vue')
    },
    {
        path: "/google",
        name: "GoogleLogin",
        component: () => import ('../components/GoogleLogin.vue')
    },
    {
        path: "/hospital",
        name: "HopsitalInput",
        component: () => import ('../components/HospitalInput.vue')
    },
    {
        path: "/bill",
        name: "BillInput",
        component: () => import ('../components/Bill.vue')
    },
    {
        path: "/billtype",
        name: "BillType",
        component: () => import ('../components/BillType.vue')
    },
    {
        path: "/",
        name: "SignUp",
        component: () => import ('../components/SignUp.vue')
    },
    {
        path: "/insurance",
        name: "Insurance",
        component: () => import ('../components/InsuranceType.vue')
    },
    {
        path: "/register",
        name: "register",
        component: () => import ('../components/Register.vue')
    }
]
const router = createRouter({
    history: createWebHistory(),
    routes,
  });
  
  export default router;
